Frozen Planet Christmas Special: The Epic Journey

Nature Documentary hosted by David Attenborough, published by BBC in 2011 - English narration


Information
------------------------------

This Frozen Planet Christmas Special episode 8 &quot;The Epic Journey&quot; brings together the very best highlights of the series, taking viewers on a spectacular journey through the entire polar year - from the depths of winter to the melting world of the polar summer. In the south, spring starts with the comical stone-stealing Adelie penguin males. In summer the females return and the parents struggle to raise their chicks before the big freeze of autumn. In the north, tiny polar bear cubs begin their lives under the snow, while the male faces the harshest winter on Earth. Will all three cubs survive as the ice melts beneath their feet? These stories, together with unforgettable moments from Frozen Planet's other characters, play out against breathtaking polar scenery in this one-hour special.

